import { LOAD_ANS, LOAD_CLEAR, LOAD_BTNS, LOAD_BACKSPACE } from "./actionsType";

export const loadBtns = (number) => {
  return {
    type: LOAD_BTNS,
    payload: number,
  };
};
export const loadAns = (number) => {
  return {
    type: LOAD_ANS,
    payload: number,
  };
};
export const loadClear = (number) => {
  return {
    type: LOAD_CLEAR,
    payload: number,
  };
};
export const loadBackSpace = (number) => {
  return {
    type: LOAD_BACKSPACE,
    payload: number,
  };
};
